// React
import React, { useState, Fragment } from "react";

// Third part
import { Table, Divider } from "antd";
import { DeleteFilled, EditFilled } from "@ant-design/icons";
import { column } from "./column";

const { Column, ColumnGroup } = Table;

const PersonalTable = ({ data }) => {
  return (
    <Table
      bordered
      columns={column}
      dataSource={data}
      bordered
      size="middle"
      scroll={{ x: 1300 }}
    >
      <ColumnGroup title="Employee Info">
        <Column
          title="First name"
          dataIndex="first_name"
          fixed="left"
          width="50px"
          sorter={(a, b) => a.first_name.length - b.first_name.length}
        />
        <Column
          title="Last name"
          dataIndex="last_name"
          fixed="left"
          width="50px"
          sorter={(a, b) => a.first_name.length - b.first_name.length}
        />
        <Column
          title="age"
          dataIndex="age"
          width="30px"
          sorter={(a, b) => a.age - b.age}
        />
        <Column
          title="gender"
          dataIndex="gender"
          filters={[
            { text: "Male", value: "Male" },
            { text: "Female", value: "Female" }
          ]}
          width="30px"
          filterMultiple={false}
          onFilter={(value, record) => record.gender.indexOf(value) === 0}
        />
        <Column
          title="Address"
          dataIndex="address"
          filters={[
            {
              text: "Huangpu",
              value: "Huangpu"
            },
            {
              text: "Changning",
              value: "Changning"
            },
            {
              text: "Jing'an",
              value: "Jing'an"
            },
            {
              text: "Putuo",
              value: "Putuo"
            },
            {
              text: "Hongkou",
              value: "Hongkou"
            },
            {
              text: "Yangpu",
              value: "Yangpu"
            },
            {
              text: "Minhang",
              value: "Minhang"
            },
            {
              text: "Baoshan",
              value: "Baoshan"
            },
            {
              text: "Jiading",
              value: "Jiading"
            },
            ,
            {
              text: "Pudong",
              value: "Pudong"
            },
            ,
            {
              text: "Jinshan",
              value: "Jinshan"
            },
            ,
            {
              text: "Songjiang",
              value: "Songjiang"
            },
            ,
            {
              text: "Qingpu",
              value: "Qingpu"
            },
            ,
            {
              text: "Fengxian",
              value: "Fengxian"
            },
            ,
            {
              text: "Chongming",
              value: "Chongming"
            }
          ]}
          width="30px"
          onFilter={(value, record) => record.address.indexOf(value) === 0}
        />
        <Column
          title="Phone"
          dataIndex="phone_number"
          width="40px"
          sorter={(a, b) => a.phone_number.length - b.phone_number.length}
        />
        <Column
          title="Position"
          dataIndex="work_position"
          filters={[
            {
              text: "Chef",
              value: "Chef"
            },
            {
              text: "Waiter",
              value: "Waiter"
            },
            {
              text: "Manager",
              value: "Manager"
            },
            {
              text: "Cleaner",
              value: "Cleaner"
            }
          ]}
          onFilter={(value, record) =>
            record.work_position.indexOf(value) === 0
          }
          width="40px"
        />
        <Column
          title="Salary"
          dataIndex="salary"
          width="50px"
          sorter={(a, b) => a.salary.length - b.salary.length}
        />
        <Column
          title="Email"
          dataIndex="email"
          width="50px"
          sorter={(a, b) => a.email.length - b.email.length}
        />
        <Column
          title="Date"
          dataIndex="date"
          width="50px"
          sorter={(a, b) => a.date.length - b.date.length}
        />
      </ColumnGroup>
      <Column
        fixed="right"
        key={data => data.id}
        title="Action"
        render={(text, record) => (
          <Fragment>
            <DeleteFilled
              className="btn btn-danger"
              onClick={() => deleteItem(record.id)}
            />

            <Divider type="vertical" />
            {/* <EditFilled
              className="btn btn-primary"
              onClick={() => editItem(record)}
            /> */}
          </Fragment>
        )}
      />
    </Table>
  );
};

export default PersonalTable;
